import { React, useState, useEffect } from "react";
import axios from "axios";

export default function WeatherTest() {
  const [city1, setCity1] = useState([]);
  const [city2, setCity2] = useState([]);
  const [city3, setCity3] = useState([]);
  const [city4, setCity4] = useState([]);

  const first_url =
    "https://api.openweathermap.org/data/2.5/weather?q=Dubai&units=imperial&appid=13d18577b2830ec2f799fbc8d0818acf";

  const second_url = "https://api.openweathermap.org/data/2.5/weather?q=Los+Angeles&units=imperial&appid=13d18577b2830ec2f799fbc8d0818acf";

  const third_url = "https://api.openweathermap.org/data/2.5/weather?q=London&units=imperial&appid=13d18577b2830ec2f799fbc8d0818acf";

  const fourth_url = "https://api.openweathermap.org/data/2.5/weather?q=New+York&units=imperial&appid=13d18577b2830ec2f799fbc8d0818acf";

  useEffect(() => {
    axios.get(first_url).then((response) => {
      setCity1(response.data.main.temp.toFixed());
      // console.log(response.data);
    });
    axios.get(second_url).then((response) => {
      setCity2(response.data.main.temp.toFixed());
      // console.log(response.data);
    })
    axios.get(third_url).then((response) => {
      setCity3(response.data.main.temp.toFixed());
      // console.log(response.data);
    })
    axios.get(fourth_url).then((response) => {
      setCity3(response.data.main.temp.toFixed());
      // console.log(response.data);
    })
  }, []);

  return (
    <div className="test">
      <div className="title">
        <h4>Current Weather</h4>
        {/* <p>{data}</p> */}
        <h4 className="real-temp">{[city1]}째F</h4>
        <h4 className="real-temp">{[city2]}째F</h4>
        <h4 className="real-temp">{[city3]}째F</h4>
        <h4 className="real-temp">{[city4]}째F</h4>
      </div>
    </div>
  );
}
